import React from "react";
import styles from "./Footer.module.css"
import { Container, Row, Col } from 'react-bootstrap';

function Footer(){
  return (
  <footer class={styles.footer}>
    <Container fluid class={styles.footer}>
      <Row>
        <Col>1 of 1</Col>
      </Row>
    </Container>
  </footer>
  )
};

export default Footer;
